import React, { useState, useEffect } from 'react';
import { Box, Typography, TextField, Button, Paper, Grid } from '@mui/material';
import { ArrowBack, ArrowForward, PlayArrow, Pause } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';

const FrequencyCountPage = () => {
  const navigate = useNavigate();
  const [array, setArray] = useState<number[]>([]);
  const [inputValue, setInputValue] = useState('');
  const [currentStep, setCurrentStep] = useState(0);
  const [isPlaying, setIsPlaying] = useState(false);
  const [frequencyMap, setFrequencyMap] = useState<Map<number, number>>(new Map());
  const [highlightedIndex, setHighlightedIndex] = useState<number | null>(null);

  const handleArrayInput = (value: string) => {
    const numbers = value.split(',').map(num => parseInt(num.trim()));
    if (numbers.every(num => !isNaN(num))) {
      setArray(numbers);
      setCurrentStep(0);
      setFrequencyMap(new Map());
      setHighlightedIndex(null);
    }
  };

  const visualizeStep = (step: number) => {
    if (array.length === 0 || step >= array.length) {
      setHighlightedIndex(null);
      return;
    }

    const currentNum = array[step];
    const newFrequencyMap = new Map(frequencyMap);
    newFrequencyMap.set(currentNum, (newFrequencyMap.get(currentNum) || 0) + 1);
    setFrequencyMap(newFrequencyMap);
    setHighlightedIndex(step);
  };

  useEffect(() => {
    if (isPlaying) {
      const timer = setInterval(() => {
        setCurrentStep(prev => {
          if (prev >= array.length - 1) {
            setIsPlaying(false);
            return prev;
          }
          return prev + 1;
        });
      }, 1000);
      return () => clearInterval(timer);
    }
  }, [isPlaying, array.length]);

  useEffect(() => {
    visualizeStep(currentStep);
  }, [currentStep, array]);

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Frequency Count Algorithm
      </Typography>
      
      <Paper sx={{ p: 2, mb: 3 }}>
        <Typography variant="body1" paragraph>
          The Frequency Count technique is used to count the occurrences of each element in an array.
          It uses a hash map to store the frequency of each element, allowing for O(1) lookups and updates.
        </Typography>
      </Paper>

      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <TextField
            fullWidth
            label="Enter array (comma-separated numbers)"
            value={inputValue}
            onChange={(e) => setInputValue(e.target.value)}
            onBlur={(e) => handleArrayInput(e.target.value)}
            margin="normal"
          />
        </Grid>

        <Grid item xs={12}>
          <Box sx={{ display: 'flex', justifyContent: 'center', mb: 2 }}>
            {array.map((num, index) => (
              <Box
                key={index}
                sx={{
                  width: 60,
                  height: 60,
                  border: '2px solid #1976d2',
                  borderRadius: 1,
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  mx: 0.5,
                  backgroundColor: highlightedIndex === index ? '#bbdefb' : 'white',
                  transition: 'background-color 0.3s',
                }}
              >
                <Typography variant="h6">{num}</Typography>
              </Box>
            ))}
          </Box>
        </Grid>

        <Grid item xs={12}>
          <Box sx={{ display: 'flex', justifyContent: 'center', gap: 2, mb: 2 }}>
            <Button
              variant="contained"
              startIcon={<ArrowBack />}
              onClick={() => setCurrentStep(prev => Math.max(0, prev - 1))}
              disabled={currentStep === 0}
            >
              Previous
            </Button>
            <Button
              variant="contained"
              onClick={() => setIsPlaying(!isPlaying)}
              startIcon={isPlaying ? <Pause /> : <PlayArrow />}
            >
              {isPlaying ? 'Pause' : 'Play'}
            </Button>
            <Button
              variant="contained"
              endIcon={<ArrowForward />}
              onClick={() => setCurrentStep(prev => Math.min(array.length - 1, prev + 1))}
              disabled={currentStep === array.length - 1}
            >
              Next
            </Button>
          </Box>
        </Grid>

        <Grid item xs={12}>
          <Paper sx={{ p: 2, bgcolor: '#f5f5f5' }}>
            <Typography variant="h6" gutterBottom>
              Frequency Map:
            </Typography>
            <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
              {Array.from(frequencyMap.entries()).map(([key, value]) => (
                <Paper key={key} sx={{ p: 1, bgcolor: 'white' }}>
                  {key}: {value} {value === 1 ? 'time' : 'times'}
                </Paper>
              ))}
            </Box>
            <Typography variant="body2" color="text.secondary" sx={{ mt: 1 }}>
              Step {currentStep + 1} of {array.length}
            </Typography>
          </Paper>
        </Grid>

        <Grid item xs={12}>
          <Paper sx={{ p: 2, bgcolor: '#f5f5f5' }}>
            <Typography variant="h6" gutterBottom>
              Implementation
            </Typography>
            <pre style={{ margin: 0, whiteSpace: 'pre-wrap' }}>
{`function countFrequency(arr: number[]): Map<number, number> {
  const frequencyMap = new Map<number, number>();
  
  for (const num of arr) {
    frequencyMap.set(num, (frequencyMap.get(num) || 0) + 1);
  }
  
  return frequencyMap;
}`}
            </pre>
          </Paper>
        </Grid>
      </Grid>
    </Box>
  );
};

export default FrequencyCountPage;
